import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import './App.css';

class App extends Component {
  render() {
    const buttonStyle ={
      marginLeft :"auto"
    };
    return (
      <Button variant="light" style={buttonStyle}>Hello World</Button>
    );
  }
}

export default App;
